    [],nt"revision_timestamp": "2016-07-27T23:05:28.613487",nt"name": "reptiles-of-the-sand-hills-of-nebraska",nt"isopen":
    false,nt"url": null,nt"notes": "This document is three proposals from the
    Miami University in Oxford, Ohio.  These research studies each involve work at the
    Valentine National Wildlife Refuge and require special use permits for surveying.
     The studies include (1) "Impact of Egg Content on Post-hatching Size, Body Composition
    and Performance in the Common Snapping Turtle (Chelydra serpentina)" that is aimed
    at determining the impact of variation in the amount of maternally invested water
    on the mass and body and yolk sac composition (dry mass and water content) and examining
    the effects of hatching size on locomotor performance (swimming speed) and predatory
    efficienc yof hatchling snapping turtles.  (2) "The Effects of Grazing on the Ornate
    Box Turtle (Terrapene omata) and Other Reptiles" which is aimed to determine the
    effects of livestock grazing on the distribution and behavior of the ornate box
    turtle and of other terrestrial reptiles in the Sand Hills of Nebraska.  and (3)
    "Locomotor Performance of Reptiles of the Sand Hills of Nebraska" which is aimed
    to determine how box turtles and lizards native to the Sand Hills are physiologically
    adapted for this environment.",nt"license_title": "License Not Specified",nt"extras":
